import CourseTiles from "../componets/CourseTiles"
const Dashboard =()=>{
    return(
        <div className="DASHBOARD ">
            <h2>DASHBOARD</h2>
            <div className="flex border ">
                <CourseTiles/>
                <CourseTiles/>
                <CourseTiles/>
            </div>
        </div>
    )
}

export default Dashboard;
